import Container from "../components/container";
import Table from "../components/table";
import Hero from "../components/hero";

function Index() {
  return (
    <div>
      <Head>
        <title>Weather App - Home</title>
      </Head>
      <Container>
        <Hero />
        <Table />
      </Container>
    </div>
  );
}

export default Index;
